import React from "react";


const Form = (name, setName,) => {

    return (
    <form>
      <input type="text" className="todo-input" />
      <input type="date" />
      <button className="todo-button" type="submit">
        <i className="fas fa-plus-square"></i>
      </button>
    </form>
    );
};

export default Form;
